import React from 'react'
import { Switch, RouteChildrenProps, Route } from 'react-router-dom'
import firebase from 'firebase/app'
import 'firebase/auth'

import { NotFound } from 'pages/admin/NotFound'

import { Navbar } from 'layout/admin/Navbar'
import { Footer } from 'layout/admin/Footer'
import { SideNavbar } from 'layout/admin/SideNavbar'

// import { Home } from 'pages/front/Home'
// import { SignIn } from 'pages/Front/SignIn'
// import { ForgotPassword } from 'pages/Front/ForgotPassword'
// import { EmailActions } from 'pages/Front/EmailActions'

import { MainPanel, FrontContentWrapper } from './styledComponents'
import { TEPrivateRoute } from 'react-tec'

const authChecks = [
	{
		check: () => {
			const fbAuth = firebase.auth()
			return !!fbAuth?.currentUser
		},
		path: '/',
	},
]

interface Props extends RouteChildrenProps {}
export const ContentWrapper: React.FC<Props> = (props) => {
	const { history } = props

	return (
		<MainPanel>
			<Navbar history={history} />
			<FrontContentWrapper>
				<Switch>
					<TEPrivateRoute path='/admin/rsvps' authChecks={authChecks} />
					<TEPrivateRoute path='/admin/messages' authChecks={authChecks} />

					<Route component={NotFound} />
				</Switch>
			</FrontContentWrapper>
			<Footer />
		</MainPanel>
	)
}
